import React from 'react';
import './CustomButton.css'; // Создадим новый CSS-файл

const CustomButton = ({ children, onClick }) => {
  return (
    <button className="custom-button" onClick={onClick}>
      {children}
    </button>
  );
};

export default CustomButton;
